import React from "react";
import "./style.css";

function Users() {
  return (
    <>
      <div class="cntr-innr">
	  <label class="search" for="inpt_search">
			<input id="inpt_search" type="text" />
		</label>
		<p>Hover to see the magic.</p>
	</div>
    </>
  );
}

export default Users;
